Guidance:
This section should:
(1) define the purpose of the particular Stakeholder Requirements Specification;
(2) specify the intended readership of the Stakeholder Requirements Specification.

This section should describe the real world the software is to operate in. This narrative description may be supported by context diagrams, to summaries external interfaces, and system block diagrams, to show how the activity fits within the larger system. The nature of the exchanges with external systems should be specified.
If a Stakeholder Requirements Specification defines a product that is a component of a parent system or project then this section should:
· outline the activities that will be supported by external systems;
· reference the Interface Control Documents that define the external interfaces with the other systems;
· describe the computer infrastructure to be used.

This section should:
(1)	describe what the rest of the Stakeholder Requirements Specification contains;
(2)	explain how the Stakeholder Requirements Specification is organized.

This section should:
(1) identify the software product(s) to be produced by name;
(2)	explain what the proposed software will do (and will not do, if necessary);
(3)	describe relevant benefits, objectives, and goals as precisely as possible;
(4)	be consistent with similar statements in higher-level specifications, if they exist.

